import { Button } from "./Button";
import { Menu } from "./Menu";

export function Home() {
    return (<>
        Container



        <Button
            bgcolor="dodgerblue"
            title="버튼1"
            func={() => console.log("버튼1이 클릭됨")}
        />
        <Button
            bgcolor="lightgreen"
            title="버튼2"
            func={() => console.log("버튼2가 클릭됨")}
        />
        <Button
            bgcolor="teal"
            title="버튼3"
            func={() => console.log("버튼3이 클릭됨")}
        />
        <Button />
        <Menu />
    </>);
}
